import React from "react";
import { Route, Navigate } from "react-router-dom";

const ProtectedAdminRoute = ({
  element: Component,
  isAdmin,
  ...otherProps
}) => {
  return isAdmin ? (
    <Route {...otherProps} element={<Component />} />
  ) : (
    <Navigate to="/" />
  );
};

export default ProtectedAdminRoute;
